	<!-- Welcome template -->
	<script id="welcomeTemplate" type="text/x-handlebars-template">
		<div class="hero-unit">
			<img class="welcome-logo" src="images/SpartanLogo.png"/>
			<h1 class="fullNameWelcome">Superior Senior High class of 1993</h1>
			<h1 class="shortNameWelcome">SSHS class of 1993</h1>
			<p>Reunion planning, etc.</p>
			<div style="clear:both;"></div>
		</div>

		<div class="row">
			<div class="span8">
				<h2>Reunion</h2>
				<h3>July 26<sup>th</sup> and 27<sup>th</sup>, 2013</h3>
				<h4>Friday Night — Family Night</h4>
				<p>Bring the kids and relive your youth at the World of Wheels skate center. As retro as you remember, but with new management focused on good clean family fun! Private party for all reunion attendees and their families from 5PM to 7PM. Entry and skate rental is free.</p>
				<h4>Friday Night — Social Event</h4>
				<p>7PM at Ace’s on 29th - just for the Class of 1993 &amp; guests:
					<ul>
						<li>Exclusive mixed drinks and beer specials</li>
						<li>Reserved volleyball courts, patio, and back room</li>
						<li>Exclusive deals on pizzas</li>
						<li>Full menu also available</li>
					</ul>
				</p>
				<h4>Saturday — Golf Tournament</h4>
				<p>Nemadji Golf Course - Competitive and “just for fun” brackets with prizes! 10AM shotgun start.</p>
				<h4>Saturday – Choose Your Own Adventure</h4>
					<ul>
						<li><a href="http://www.superiorchamber.org" title="Superior-Douglas County Chamber of Commerce">Superior-Douglas County Chamber of Commerce</a></li>
						<li><a href="http://visitduluth.com/home.php" title="VisitDuluth.com :: The Official Duluth Travel Guide">VisitDuluth.com :: The Official Duluth Travel Guide</a></li>
						<li><a href="http://www.douglashistory.org" title="Douglas County Historical Society">Douglas County Historical Society</a></li>
						<li><a href="http://www.superiorpublicmuseums.org" title="Superior Public Museums">Superior Public Museums</a></li>
						<li><a href="http://visitduluth.com/tallships2013/" title="Tall Ships Duluth 2013">Tall Ships Duluth 2013</a></li>
						<li><a href="http://www.superiorpaintball.net/" title="Superior Paintball">Superior Paintball</a></li>
						<li><a href="http://dnr.wi.gov/topic/parks/name/pattison" title="Pattison Park">Pattison Park</a></li>
						<li><a href="http://dnr.wi.gov/topic/parks/name/amnicon" title="Amnicon Park">Amnicon Park</a></li>
						<li><a href="http://www.spiritmt.com/adventure-park/index.html" title="Adventure Park - Spirit Mountain">Adventure Park - Spirit Mountain</a></li>
						<li><a href="http://www.skimontdulac.com/index-summer.php" title="Mont Du Lac Recreation">Mont Du Lac Recreation</a></li>
					</ul>
				</p>
				<h4>Saturday Night — Main Event</h4>
				<p>Come relive the All Night Graduation Party* at the beautiful new Yellowjacket Union on the UWS campus. Planned activities include Dinner, Dancing, Casino Night, Karaoke, a Hypnotist and reliving the “glory days”.</p>
				<br/>
				<p>* This will not be an all night event</p>
			</div>
			<div class="span4">
				<h2>Venues</h2>
				<ul>
					<li><a href="http://wowsk8.us" title="Friday night - family night">World of Wheels</a></li>
					<li><a href="http://aceson29.com" title="Friday night - social event">Aces on 29th</a></li>
					<li><a href="http://www.nemadjigolf.com" title="Saturday - golf tournament">Nemadji Golf Course</a></li>
					<li><a href="http://www.flickr.com/photos/uw-superior/4626894776/in/photostream/" title="Saturday night - main event">Yellowjacket Union</a></li>
				</ul>
			</div>
		</div>
		<div class="row">
		</div>


	</script>
